import React from 'react';
import {
    Grommet,
Form,
FormField,
} from 'grommet';

const FluffForm = () => {
    const [value, setValue] = React.useState({ name: 'a', email: 'b' });
    return(
        <Grommet>
            <Form
                value = {value}
                >
            <FormField>
                <TextInput name="hi"/>
            </FormField>
            </Form>
        </Grommet>
    );
};

export default FluffForm;
